<map id="plantuml_map_ae9df63d-dfed-4b92-b556-93d9782d51c5" name="plantuml_map_ae9df63d-dfed-4b92-b556-93d9782d51c5">
<area shape="rect" id="id1" href="End.html" title="End is a final pseudo-state with only inputs and no outputs indicating completion of a flow. " alt="" coords="1611,1378,1665,1434"/>
<area shape="rect" id="id2" href="Join.html" title="Join is a pseudo-state which merges flow parallel execution branches. " alt="" coords="1080,1378,1135,1434"/>
<area shape="rect" id="id3" href="Fork.html" title="Fork is a pseudo-state which splits flow elements execution into parallel branches. " alt="" coords="447,1378,503,1434"/>
<area shape="rect" id="id4" href="Start.html" title="Start is an initial pseudo-state with only outputs and no inputs indicating start of a flow. " alt="" coords="1404,1378,1461,1434"/>
<area shape="rect" id="id5" href="Choice.html" title="Choice is a conditional pseudo-state." alt="" coords="974,1378,1045,1434"/>
<area shape="rect" id="id6" href="InputPin.html" title="Input is a pseudo-state displayed as a square on the border of the containing parition flow through which calls initiate the flow. " alt="" coords="1170,1378,1247,1434"/>
<area shape="rect" id="id7" href="ExitPoint.html" title="Exit point is a pseudo-state displayed as a crossed circle on the border of the containing partition flow through which transitions leave the flow. " alt="" coords="1496,1378,1575,1434"/>
<area shape="rect" id="id8" href="Package.html" title="Package is a container of sub-packages, flows, resources, participants, and artifacts." alt="" coords="1540,273,1620,329"/>
<area shape="rect" id="id9" href="Activity.html" title="Activity describes something performed by a participant." alt="" coords="1536,1160,1617,1220"/>
<area shape="rect" id="id10" href="OutputPin.html" title="Output pin is a pseudo-state displayed as a square on the border of the containing partition flow through which calls are made to other flow elements." alt="" coords="1283,1378,1369,1434"/>
<area shape="rect" id="id11" href="Resource.html" title="Something that is used by participants for completion of flow elements. " alt="" coords="1138,806,1224,862"/>
<area shape="rect" id="id12" href="EntryPoint.html" title="Entry point is a pseudo-state displayed as a circle on the border of the containing partition flow through which transitions enter the flow. " alt="" coords="690,1378,777,1434"/>
<area shape="rect" id="id13" href="CallEntry.html" title="Mapping of a call key to a call. " alt="" coords="939,1264,1020,1333"/>
<area shape="rect" id="id14" href="ExpansionInput.html" title="Expansion input is a pseudo-state which can be used instead of partition start pseudo-state to indicate that the partition flow input is a collection and the flow is executed for each element in the collection." alt="" coords="538,1378,655,1434"/>
<area shape="rect" id="id15" href="ActivityEntry.html" title="Mapping of activity key to an activity or a flow. " alt="" coords="1641,630,1735,700"/>
<area shape="rect" id="id16" href="ArtifactEntry.html" title="A mapping of an artifact key to an artifact. " alt="" coords="505,441,600,511"/>
<area shape="rect" id="id17" href="Service.html" title="Service is a reference to a shared activity used in multiple flows. " alt="" coords="1737,1371,1833,1440"/>
<area shape="rect" id="id18" href="Flow.html" title="Flow is a composite activity. " alt="" coords="2021,1371,2119,1440"/>
<area shape="rect" id="id19" href="ExpansionOutput.html" title="Expansion output is a pseudo-state which can be used instead of partition end pseudo-state to indicate that the partition flow output is a collection and the output transitions are executed for each element in the collection." alt="" coords="813,1378,939,1434"/>
<area shape="rect" id="id20" href="PseudoState.html" title="Base class for transient flow elements in the flow graph. " alt="" coords="1003,1157,1106,1226"/>
<area shape="rect" id="id21" href="Participant.html" title="Something that participates in completion of flow elements - a human, an organization, a system. " alt="" coords="1309,1157,1413,1226"/>
<area shape="rect" id="id22" href="PackageEntry.html" title="Mapping of a sub-package key to a sub-package. " alt="" coords="1616,441,1723,511"/>
<area shape="rect" id="id23" href="ServiceProvider.html" title="Base class for package elements which can provide services - activities and flows, which can be referenced from other activities and flows. " alt="" coords="1284,445,1415,504"/>
<area shape="rect" id="id24" href="ResourceEntry.html" title="Mapping of resource key to a resource. " alt="" coords="1211,630,1324,700"/>
<area shape="rect" id="id25" href="TransitionEntry.html" title="Mapping of an output key to a transition. " alt="" coords="649,1157,763,1226"/>
<area shape="rect" id="id26" href="ParticipantEntry.html" title="Mapping of a participant key to a participant. " alt="" coords="1868,1371,1985,1440"/>
<area shape="rect" id="id27" href="Relationship.html" title="Relationship between artifacts. " alt="" coords="996,967,1098,1051"/>
<area shape="rect" id="id28" href="Call.html" title="Call is a specialization of transition which has blocking “request-reply” semantics where the calling flow element waits for a response from the callee. " alt="" coords="223,1526,349,1595"/>
<area shape="rect" id="id29" href="RelationshipEntry.html" title="Mapping of relationship keys (qualifiers) to a relationships. " alt="" coords="862,799,991,868"/>
<area shape="rect" id="id30" href="FlowElementEntry.html" title="Mapping of a flow element key to a flow element. " alt="" coords="1733,1526,1864,1595"/>
<area shape="rect" id="id31" href="Transition.html" title="Transition connects two flow elements, e.g. activities and is navigated when execution of the source element is completed and execution of the target element shall begin. " alt="" coords="156,1364,274,1447"/>
<area shape="rect" id="id32" href="RepresentationEntry.html" title="Mapping of representation key to a representation (diagram). " alt="" coords="1163,259,1307,342"/>
<area shape="rect" id="id33" href="Artifact.html" title="Input to a flow element, e.g. activity, or an output from a flow element. " alt="" coords="761,610,890,721"/>
<area shape="rect" id="id34" href="ArtifactParticipantResponsibility.html" title="Responsibility assignments for an artifact at the activity level if different from the activity responsibility assignments." alt="" coords="266,1150,470,1233"/>
<area shape="rect" id="id35" href="FlowElement.html" title="FlowElement is an abstract base class for Flow elements. " alt="" coords="815,943,964,1072"/>
<area shape="rect" id="id36" href="PackageElement.html" title="Base class for elements which can be contained in a package and as such inherited, overridden, and suppressed." alt="" coords="1078,38,1219,181"/>
<area shape="rect" id="id37" href="ParticipantResponsibility.html" title="Base class for elements for which participants can responsible for, accountable, consulted, or informed. " alt="" coords="1069,417,1251,532"/>
